import { View ,Text } from "react-native-web";
import {styles} from "./styles"
import Input from "../../components/input";

const lab3 = () => (
  <View style={styles.container}>
    <Text style={styles.text}>React Native</Text>
    <Input></Input>
  </View>
  
);

export default lab3;
